fun main() {
    do {
        var doCalculate = true
        val operation: String = readln().trim().lowercase()
        var op0 = ""
        var op1 = ""
        var whatToDo = '0'
        var temp0: String = operation
        do {
            val temp1: Char = temp0.first()
            if (temp0.isNotEmpty()) temp0 = temp0.drop(1)
            when (temp1) {
                '+', '-', '/', '*', '%' -> whatToDo = temp1
                else -> {
                    if (temp1.isDigit()) if (whatToDo.isDigit()) op0 += temp1
                    else op1 += temp1
                    else {
                        println("There is letter in there"); doCalculate = false
                    }
                }
            }
        } while (temp0.isNotEmpty() && doCalculate)
        if (doCalculate) {
            print("$op0$whatToDo$op1 = ")
            val calTemp = op0.toBigInteger()
            val calTemp0 = op1.toBigInteger()
            when (whatToDo) {
                '-' -> println(calTemp - calTemp0)
                '+' -> println(calTemp + calTemp0)
                '%' -> println(calTemp % calTemp0)
                '/' -> {
                    if (op1 != "0") println(calTemp / calTemp0) else{errorMeassage()}
            }
                '*' -> println(calTemp * calTemp0)
            }
        }
        var doApp:String
        do {println("redo? (n/y)")
        doApp = readln().trim().lowercase()
        }while (doApp != "n" && doApp != "y")
    }while (doApp == "y")
}


























































